import React from 'react';

const CargoItem = ({ cargo }) => {
  let statusColor;

  switch (cargo.status) {
    case 'Ожидает отправки':
      statusColor = 'warning';
      break;
    case 'В пути':
      statusColor = 'primary';
      break;
    case 'Доставлен':
      statusColor = 'success';
      break;
    default:
      statusColor = 'secondary';
  }

  return (
    <tr>
      <td>{cargo.id}</td>
      <td>{cargo.name}</td>
      <td>
        <span className={`badge bg-${statusColor}`}>{cargo.status}</span>
      </td>
      <td>{cargo.origin}</td>
      <td>{cargo.destination}</td>
      <td>{cargo.departureDate}</td>
    </tr>
  );
};

export default CargoItem;
